[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,    # Slot in the socket on this side
    EXP1_7=PE14, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PA6, EXP2_2=PA5,
    EXP2_3=PB1, EXP2_4=PA4,
    EXP2_5=PB2, EXP2_6=PA7,      # Slot in the socket on this side
    EXP2_7=PC15, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=PC5


#####################################################################
#   Extruder Settings
#####################################################################

[tmc2209 extruder]
uart_pin: EBB:gpio20
run_current: 0.650
stealthchop_threshold: 0

[filament_switch_sensor filament_sensor]
pause_on_runout: True
runout_gcode:
    M117 Filament Runout Detected ; Display a message
    PAUSE                         ; Pause the print
insert_gcode:
    M117 Filament Inserted        ; Display a message
    RESUME                        ; Resume the print
switch_pin: EBB:gpio13            ; Correct pin configuration

[extruder]
max_extrude_only_distance: 1000.0
max_extrude_cross_section: 1000.0
step_pin: EBB:gpio18
dir_pin: EBB:gpio19
enable_pin: !EBB:gpio17
# rotation_distance: 46.515828537772  # Bondtech 5mm Drive Gears
rotation_distance: 47.088 #47.088
gear_ratio: 9:1                     # BMG Gear Ratio
microsteps: 32
full_steps_per_rotation: 200        # 200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.400
filament_diameter: 1.75
heater_pin: EBB:gpio7
sensor_type: PT1000                 # Update to PT1000 for the new thermistor
pullup_resistor: 2200               # Correct pull-up resistor value
sensor_pin: EBB:gpio26 
min_temp: 10
max_temp: 400
max_power: 1.0
min_extrude_temp: 170
pressure_advance: 0.04
#pressure_advance_smooth_time: 0.040

# ================================
# CARTOGRAPHER
# ================================
[scanner]
serial:  /dev/serial/by-id/usb-Cartographer_614e_1B0009801243304146393320-if00
## canbus_uuid: 39e138872b4e            
x_offset: 0                          #adjust for your offset
y_offset: 15                         #adjust for your offset
# calibration_method: touch 
sensor: cartographer
sensor_alt: carto                    #alternate name to call commands. CARTO_TOUCH etc
# scanner_touch_z_offset: 0.05         #this is the default and will be overwritten and added to the DO NOT SAVE area by using UI to save z offset
backlash_comp: 0.00281

[temperature_sensor Cartographer_MCU]
sensor_type: temperature_mcu
sensor_mcu: scanner
min_temp: 0
max_temp: 105

# ================================
# LEVELING & MESHING
# ================================
# [bed_mesh]
# speed: 250
# probe_count: 50,50
# zero_reference_position: 175,175
# mesh_min: 30,30
# mesh_max: 320,320
# algorithm: bicubic
# horizontal_move_z: 11
# # adaptive_margin: 5

[bed_mesh]
zero_reference_position: 175, 175    
# Center of the usable bed area (350mm / 2 = 175mm)

speed: 250
# Movement speed of the toolhead during bed mesh

horizontal_move_z: 5
# Height of the toolhead during bed mesh probe movements

mesh_min: 20, 20
# X minimum: 5 mm (close to the left edge with minimal margin)
# Y minimum: 15 mm (to account for the 15 mm probe offset)

mesh_max: 330, 330
# X maximum: 345 mm (close to the right edge with minimal margin)
# Y maximum: 335 mm (350 mm - 15 mm probe offset)

probe_count: 50, 50
# High-resolution mesh; adjust to 15, 15 for faster probing if desired

algorithm: bicubic
# Bicubic interpolation for smoother mesh compensation

[quad_gantry_level]
gantry_corners:
	-60,-10
	410,420
points:
	50,25
	50,275
	300,275
	300,25
speed: 400
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.01
max_adjust: 50

#####################################################################
#   Bed Heater Settings
#####################################################################

[heater_bed]
heater_pin: PA3
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PF3
max_power: 1
min_temp: 0
max_temp: 115

#####################################################################
#   Fan Control
#####################################################################

[fan]
pin: EBB:gpio14
kick_start_time: 0.5
max_power: 1
off_below: 0.10

[heater_fan hotend_fan]
pin: EBB:gpio4
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[controller_fan controller_fan]
pin: PD12
kick_start_time: 0.5
max_power: 0.5
heater: heater_bed

[controller_fan controller_fan2]
pin: PD13
kick_start_time: 0.5
max_power: 0.5
heater: heater_bed

[fan_generic Nevermore]
pin: PD14
max_power: 1.0
shutdown_speed: 0

# [heater_fan Nevermore]
# pin: PD14
# heater: extruder
# heater_temp: 240
# max_power: 1.0
# shutdown_speed: 0
# kick_start_time: 0.1

[temperature_fan EBB_SB2209]
pin: EBB:gpio5
sensor_type: Generic 3950
sensor_pin: EBB:gpio27
target_temp: 45.0
control: watermark
max_speed: 1.0
min_temp: 0
max_temp: 100
shutdown_speed: 0

#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800

[quad_gantry_level]
gantry_corners:
   -60,-10
   410,420
points:
   25, 8.5
   25, 308.5
   325, 308.5
   325, 8.5
speed: 600
horizontal_move_z: 5
retry_tolerance: 0.05
retries: 5
max_adjust: 30

#####################################################################
#   Display and Pin Configuration
#####################################################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,    # Slot in the socket on this side
